import React from "react";

const SinglePokemon = ({ imgUrl, name, number, type1, type2 }) => {
  return (
    <div>
      <img src={imgUrl} />
      <h2>{name}</h2>
      <br />
      <strong>{number}</strong>
      <br />
      <strong>{type1}</strong>
      <br />
      <strong>{type2}</strong>
      <br />
      <strong>{type2}</strong>
      <br />
    </div>
  );
};

export default SinglePokemon;
